This might seems pointless to you for know but we are going to write a crate with only Plain Old Rust Structs. Since we will need our frontend and backend aplications to exchange HTTP request it will at least save us the duplication of these structs. In the future if we want to build some tooling around our app, let's say a nice cli tool, or expose our api publicly this will be much easier. We will also need to serialize and deserialise to and from json. For that we will use the amazing serde crate. First we need to add the serde dependency to our movie-night-backend crate. Add the following line to movie-night-common/Cargo.toml : [dependencies]
serde = { version = "1.0", features = ["derive"] } That's it you can run cargo build and start writing the common crate at the same time. For now just append the folowing to movie-night-common/lib.rs use movie_night_db::users::*; /// User without its password
#[derive(Serialize, Deserialize, Debug)]
pub struct UserDto { pub id: i32, pub nickname: String, pub email: String,
} /// Add a new user
#[derive(Serialize, Deserialize, Debug)]
pub struct NewUserDto { pub nickname: String, pub email: String, pub password: String,
} impl Into<NewUser> for NewUserDto { fn into(self) -> NewUser { NewUser { nick: self.nickname, email: self.email, password_hash: self.password, // TODO: Bcrypt here } }
}
impl From<&User> for UserDto { fn from(user: &User) -> Self { UserDto { id: user.id, nickname: user.nick.clone(), email: user.email.clone(), } }
} As you can see we have two Data transfer object here, one for retrieving user with there ids and the other specifically for posting new users and persist there password in database. Quite simple actually, for those coming from the Java world, the serde Serialize and Deserialize annotation can be compared to Jackson. Actually the annotation syntax is almost the same. Now that we have some basic struct to post and retrieve new users, lets go ahead and write a web server!
